function check()
{
	time_count = 1;
	check_judgement = 0;
	for (let x = 1; x <= 9; x ++)
	{
		for (let y = 1; y <= 9; y ++)
		{
			if (table_array[(x - 1)][(y - 1)].length > 2)
			{
				check_judgement = 2;
			}
			else if (table_array[(x - 1)][(y - 1)] != answer_data[question_number].split("/")[((x - 1) * 9) + (y - 1)])
			{
				if (check_judgement < 2)
				{
					check_judgement = 1;
				}
			}
		}
	}
	if (check_judgement == 0)
	{
		document.getElementById("table_test00_0S_image").src = "attention_check1.png? raw=true";
		clearInterval(timer_start);
	}
	else if (check_judgement == 1)
	{
		document.getElementById("table_test00_0S_image").src = "attention_check2.png? raw=true";

	}
	else
	{
		document.getElementById("table_test00_0S_image").src = "attention_check3.png? raw=true";
	}
		
	time_count = 0;
}

